<!DOCTYPE html>
<html>

<head>
	<meta charset="utf-8">
	<title>全等</title>
	<script type="text/javascript">
		(function () {
			console.log("55" === 55);  // false

			console.log("55" !== 55 );  // true

			console.log(null === undefined);  // false

		})();

	</script>
</head>

<body>
</body>

</html>
